        <Route path="/signup" element={<SignupForm signup={signup} />} />
        <Route path="/exercise/:id" element={<ExerciseDetail />} />

         <PrivateRoute path="/profile" element={<ProfileForm />} />

          <Navigate to="/" />

         </Routes>

    </div>
  );

}

export default Routess;
